css:
@-moz-document domain('student.wesleycollege.net'){
body {
    font-family:Whitney, Helvetica Neue, Helvetica, Arial, sans-serif;
}

.student #menu > .nav {
    background-image: url(https://proxy.duckduckgo.com/iu/?u=https%3a%2f%2fdiscordapp.com%2fassets%2f192cb9459cbc0f9e73e2591b700f1857.svg&f=1);
    background-size: 200px;
    background-color: #7289DA;
}
#menu ul {
    background: #23272A;
}
#menu li:hover {
    background: #2C2F33;
    border-radius: 20px;
}
#menu li.item.active {
    background: #99AAB5;
}
#menu li.item.active:hover {
    border-radius: 20px;
}
#menu li {
    background: #23272A;
}
#menu li label {
    color: #FFFFFF;
}
#menu li.item.active >label {
    color: #FFFFFF;
    font-weight: 500;
}
.branded > #toolbar {
    background: #2C2F33;
}
#toolbar button:hover {
    border-radius: 20px;
    background: #7289DA;
}
#toolbar button {
    color: white;
}
#main > .dashboard {
    background: #2C2F33;
}
#main > .dashboard > .dashlet {
    background: #99AAB5;
}
div.assessment.ungraphed.unstatted.selected:hover {
    font-weight:700;
}
#main > .marks > .meta > .tasks > .assessment.selected {
    background:#2C2F33;
    
}
div.assessment.ungraphed.unstatted:hover {
    background:#36393f;
}
#main > .marks > .meta{
background: #23272A;

}
#main > .marks > .meta > .tasks > .assessment > .heading > .title{
color :white;
}

#main > .marks > .meta > .tasks > .assessment > .heading > .due{
 color:white;   
}

.programmeNavigator > .navigator > .week > .lessons > .lesson{
background:#23272A;
    color:white;
    border-bottom: 0px;
    
}

.programmeNavigator > .navigator > .week > .lessons > .lesson.selected{
background:#36393f;
    color:white;
    border-bottom: 0px;

}
.programmeNavigator > .navigator > .week > .lessons > .lesson.selected:hover{
    color:white;
    border-bottom: 0px;
    font-weight:500;
    background:#36393f;
}
.programmeNavigator > .navigator > .week > .lessons > .lesson:hover{
    color:white;
    border-bottom: 0px;
    background-color: #2C2F33;
    
}
#main{
background:#23272A;
}

.programmeNavigator > .navigator > .week > .lessons > .lesson > .meta > .sequence > .period{
    
color:white;
    font-weight: 600;
}

#main > .course > .programmeNavigator > .navigator{
background: #23272A; 
} 

.programmeNavigator > .navigator > .week > .lessons > .lesson > .meta > .sequence > .date{
font-style: italic;
    color:white;
    
}
.programmeNavigator > .navigator > .week > .lessons > .lesson.selected:hover > .meta > .sequence > .date{
font-style: italic;
    color:white;
    font-weight:700;
}
.programmeNavigator > .navigator > .week > .meta{
color:white;
    background:#2C2F33;
} 
.programmeNavigator > .navigator > .search{
    background:#2C2F33;
}


}
